import React from "react";
import BouttonLink from "../BouttonLink";
import SectionTitle from "../SectionTitle";
import SecondaryBanner from "../SecondaryBanner";
import useGetProducts from "../../hooks/userGetProducts";
import Product from "../Productt";



 



const TopProducts =() => {

    const { products } = useGetProducts()

    return (
        <div className=" container mx-auto">
            <div className=" flex items-center justify-between">
                <SectionTitle text="Top products" /> 
                <BouttonLink path="/about" text="see more" isMain />
            </div>
                {/* products */}
                <div className=' flex'>
                    {products.map(product => (

                <Product
                        key={product.id}
                        id={product.id}
                        name={product.name}
                        brand={product.brand}
                        imgUrl={product.api_featured_image}
                        price={product.price}
                        currency={product.price_sign}

                 />
                    ))}
                </div>
                <SecondaryBanner />
        </div >

    )
}

export default TopProducts
